/* Provide a helper that joins two symbols */
/// \{
#define BST_DTL_JOIN2(L, R) L ## R
#define BST_JOIN2(L, R) BST_DTL_JOIN2(L, R)
/// \}


/* Provide a helper that converts symbols to strings */
/// \{
#define BST_DTL_DTL_TOSTRING(X) #X
#define BST_DTL_TOSTRING(X) BST_DTL_DTL_TOSTRING(X)
#define BST_TOSTRING(X) BST_DTL_TOSTRING(X)
/// \}


/* Provide a helper that selects between two symbols if two constants are the same */
/// \{
#define BST_IFEQ(X, Y, T, F) BST_JOIN2(BST_DTL_IFEQ, BST_DTL_IFEQ_EXPAND(BST_DTL_IFEQ_CALL(BST_JOIN2(BST_GET_ARG, X), BST_JOIN2(BST_DTL_IFEQ_ARGS, Y))))(T, F)
#define BST_DTL_IFEQ_CALL(X, Y) X(Y)
#define BST_DTL_IFEQ_EXPAND(X) X
#define BST_DTL_IFEQ0(T, F) F
#define BST_DTL_IFEQ1(T, F) T


